import React from "react";

const Jobs = props => (

    <div className>

        { 
            props.jobs.map((job) => {
                return (

                    <div key={job.id}>

                        <img src={job.company_logo} alt={job.company}></img>
                        <p>{ job.company }</p>
                        <p>{ job.title }</p>

                    </div>
                );
            }) 
        }

    </div>
);

export default Jobs;
